<script>
  /**
   * @constructor
   * @implements {webdriver.CommandExecutor}
   */
  function FakeExecutor() {}

  /**
   * Stub responses, by command name.
   * @type {!Object}
   */
  FakeExecutor.STUB_RESPONSES = {};

  FakeExecutor.STUB_RESPONSES[webdriver.CommandName.GET_SERVER_STATUS] = {
    'status': bot.ErrorCode.SUCCESS,
    'value': {
      'os': {
        'name': 'DemoOS',
        'version': 0.1
      },
      'build': {
        'version': '2.15b1',
        'revision': 12345
      }
    },
    'delay': 0
  };

  FakeExecutor.STUB_RESPONSES[webdriver.CommandName.QUIT] = [
    {
      'parameters': {'sessionId': 'session-5678'},
      'response': {'status': bot.ErrorCode.SUCCESS},
      'delay': 250
    }
  ];

  FakeExecutor.STUB_RESPONSES[webdriver.CommandName.GET_SESSIONS] = {
    'status': bot.ErrorCode.SUCCESS,
    'value': [
      {'id': 'session-1234',
        'capabilities': {
          'browserName': 'firefox',
          'takesScreenshot': true
        }},
      {'id': 'session-5678',
       'capabilities': {
         'browserName': 'chrome'
       }}
    ],
    'delay': 500
  };

  FakeExecutor.STUB_RESPONSES[webdriver.CommandName.SCREENSHOT] = {
    'status': bot.ErrorCode.SUCCESS,
    'value': GOOGLE_SCREENSHOT,
    'delay': 500
  };


  /** @override */
  FakeExecutor.prototype.execute = function(command, callback) {
    var response = FakeExecutor.STUB_RESPONSES[command.getName()];

    if (goog.isArray(response)) {
      response = goog.array.find(response, function(response) {
        var differences = goog.testing.asserts.findDifferences(
            response['parameters'], command.getParameters());
        return !differences;
      });
      if (response) {
        response = response['response'];
      }
    }

    if (!response) {
      callback(Error('Unexpected command: ' + command.getName() + '\n' +
          goog.json.serialize(command.getParameters())));
      return;
    }

    // Simulate a slow response.
    setTimeout(function() {
      callback(null, response);
    }, response['delay'] || 0);
  };

  var client = new remote.ui.Client('http://localhost:4444/wd/hub',
      new FakeExecutor());
  client.init();
</script>
